import React from "react";
import logo from "./logo.png";
import Tilty from "react-tilty";

const Logo = () => {
  return (
    <div className="ma4 mt0">
      <Tilty className='Tilt br2 shadow-2'
       options={{ max: 55}}
       style={{ height: 150, width: 150}}>
        <img src={logo} />
      </Tilty>
    </div>
  );
};

export default Logo;
